package Week2.day3;

public class Ex_ggd {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	for(int i=1; i<=9; i++) { //단수 2~9까지 증감을 반복
		for(int j=1; j<=9; j++) { //1~9까지 곱해줄 숫자의 증감을 반복
			System.out.println(i + "*" + j + "=" + i*j+"\t"); // 단수열 * 숫자 = i*j
		}
		System.out.println(); //세로간격 줄바꿈
		
	
		}
	}
}